        blurb:
          '<span class="template_sbc"><b>Active:</b></span> <span data-game="lol" data-skin="Original" class="inline-image label-after champion-icon" style="display:inline;white-space:pre;" data-param="" data-champion="Twitch"><span data-width="20" style="display:inline-block;position:relative;" class="border"><a href="/wiki/Twitch/LoL" title="Twitch"><img alt="Twitch" width="20" decoding="async" loading="lazy" class="thumbborder lazyload" data-image-name="Twitch OriginalSquare.png" data-image-key="Twitch_OriginalSquare.png" height="20" data-relevant="0" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/f/fb/Twitch_OriginalSquare.png/revision/latest/scale-to-width-down/20?cb=20150402221633" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D"></a></span> <span style="white-space:normal;"><a title="Twitch/LoL" href="/wiki/Twitch/LoL">Twitch</a></span></span> gains <span style="white-space:nowrap"><a href="/wiki/Attack_damage" title="Attack damage"><img height="15" data-relevant="0" data-image-key="Attack_damage_icon.png" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/7/75/Attack_damage_icon.png/revision/latest/scale-to-width-down/15?cb=20170515203443" class="lazyload" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" width="15" data-image-name="Attack damage icon.png" decoding="async" alt="Attack damage icon" loading="lazy"></a>&nbsp;<span style="color:orange; white-space:normal"><b>bonus</b> attack damage</span></span> and <span style="white-space:nowrap"><a href="/wiki/Range" title="Range"><img width="15" class="lazyload" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/1/13/Range_icon.png/revision/latest/scale-to-width-down/15?cb=20170715002053" data-relevant="0" loading="lazy" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" alt="Range icon" decoding="async" data-image-key="Range_icon.png" height="15" data-image-name="Range icon.png"></a>&nbsp;<b>bonus</b> attack range</span> for a few seconds, during which his basic attacks are replaced with bolts that deal the <span style="color:orange; white-space:normal">attack\'s damage</span> to enemies hit.',
